INSERT INTO `tb_sys_goods` VALUES ('21', '水煮肉片', null, '25', '招牌必点', '48.00', '9999', '1', 'c6d78087cbd74701b77295b61b0cb0a1.jpg', 'a357937b5cfe484aaa0ca7458adaaa0f.jpg', 'd7409a0e811342839f1c5e789a97f7f8.jpg', '61cbdb349d3e42b4b715c5d1dc67c59b.jpg', 'bcfc8de9c510405195defb8fcfb04378.jpg', null, null, '水煮肉片（Poached spicy slices of pork）是以猪里脊肉为主料的一道地方新创名菜，起源于自贡，发扬于西南，属于川菜中著名的家常菜。因肉片未经划油，以水煮熟故名水煮肉片。水煮肉片肉味香辣，软嫩，易嚼。吃时肉嫩菜鲜 ，汤红油亮，麻辣味浓，最宜下饭，为家常美食之一；特色是“麻、辣、鲜、香”。', null, '10', null, null, null, null, null, null, null, null, '2021-05-12 21:04:21', null);
INSERT INTO `tb_sys_goods` VALUES ('22', '农家小炒肉', null, '25', '招牌必点', '30.00', '9999', '1', 'eeafd661e0fe4dd19f6332d5b445e7b8.jpg', '94a8f762761b439097fc58443ab2d22a.jpg', 'baaf22182c2f458f9743ad10f7866f65.jpg', '95eb0928eec141809987618dcc05e033.jpg', '5c88bf8187d24d1cbddad21d5bde32f4.jpg', null, null, '小炒肉是湖南省一道常见的特色传统名菜，属于湘菜系。麻辣鲜香，口味滑嫩。制作原料主要是五花肉和青椒、红椒等。', null, '10', null, null, null, null, null, null, null, null, '2021-05-12 21:07:39', null);
INSERT INTO `tb_sys_goods` VALUES ('23', '酸辣土豆丝', null, '25', '招牌必点', '16.00', '9999', '1', 'de4c7305148d4cc196c7148e21e22134.jpg', 'f832621b9dfc43fbb6a9457c2b9b468a.jpeg', 'ed73f8859b5a4e878e94fbafbd8fc5d2.jpg', '7299d7e67c8740cabdcb884e20fe42a0.jpg', '2cd347a821294a9eb0b5f34e138369fc.jpg', null, null, '酸辣土豆丝，是用土豆、辣椒、白醋，葱等制作而成的菜肴，色泽光亮，酸辣可口。', null, '10', null, null, null, null, null, null, null, null, '2021-05-12 21:10:51', null);
INSERT INTO `tb_sys_goods` VALUES ('24', '宫保鸡丁', null, '24', '限时特惠', '22.00', '9999', '1', '64c6b01edb2f4828827094320230959d.jpeg', '226d8f1734e34998b6ff08b73e73cb1f.jpg', '723c841d06e744bca15a9e619d2e335a.jpg', '3ed569e9c74248bba5491b7dce9357c0.jpg', 'c280e96bcd464e2a9ad050f49d85a075.jpg', null, null, '宫保鸡丁（Kung Pao Chicken），是一道闻名中外的特色传统名菜。宫保鸡丁选用鸡肉为主料，佐以花生米、辣椒等辅料烹制而成；红而不辣、辣而不猛、香辣味浓、肉质滑脆；其入口鲜辣，鸡肉的鲜嫩可以配合花生的香脆。2018年9月，被评为“中国菜”之贵州十大经典名菜、四川十大经典名菜。', '1', '8', null, null, null, null, null, null, null, null, '2021-05-12 21:15:00', null);
INSERT INTO `tb_sys_goods` VALUES ('25', '西红柿炒鸡蛋', null, '24', '限时特惠', '12.00', '9999', '1', '5fdf7d9e0f5948f8b1de70bb4565f1c9.jpeg', '07c126403e6241e3b2dfad73d7b91fc8.jpg', 'a2ae617878e74c7592635ef7d124d134.jpg', '6f3cfd64b8de4364a1237a56188112c5.jpg', '059f610366e546189804e59160449e2d.jpg', null, null, '西红柿炒鸡蛋是以西红柿，鸡蛋为主料制作的家常菜。味道酸甜可口，特别下饭。', null, '8', null, null, null, null, null, null, null, null, '2021-05-12 21:17:42', null);
INSERT INTO `tb_sys_goods` VALUES ('26', '糖醋里脊', null, '24', '限时特惠', '28.00', '9995', '1', '52b662d0854646968bb8ec3333e4dc7c.jpg', '615bb27a96ee41b1a498485824293ac9.jpg', 'bb7ec761ba58432cba27773088963184.jpg', 'a54ef31a9e7746bbb40f8fd0d61a0f1f.jpg', '1404868ac9e2440ab5b45facce0d4e13.jpg', null, null, '糖醋里脊是中国经典传统名菜之一，该菜品以猪里脊肉为主材，配以面粉、淀粉、醋等佐料，酸甜可口，让人食欲大开；该菜品在豫菜、浙菜、鲁菜、川菜、淮扬菜、粤菜、闽菜里均有此菜。2018年9月10日，“中国菜”在河南省正式发布。糖醋里脊被评为山东十大经典名菜。', '3', '8', null, null, null, null, null, null, null, null, '2021-05-12 21:20:16', null);
INSERT INTO `tb_sys_goods` VALUES ('27', '菠萝咕咾肉', null, '22', '家常炒菜', '36.00', '9999', '1', '624f74e5eb334408b6f7cb19cb177b5f.jpg', 'ebb03f47c7154f69b9e84132c12a67b0.jpg', 'fa2becf60d7844d6b5a74e89389a195d.jpg', 'b381111492924e429ccb1dce54b0b1f4.jpg', '794ef71a09294c6ba61ae89160bd2932.jpg', null, null, '菠萝咕咾肉又称咕噜肉，是广东的一道特色传统名菜，属于粤菜，以菠萝及猪肉煮成。', null, '10', null, null, null, null, null, null, null, null, '2021-05-12 21:27:52', null);
INSERT INTO `tb_sys_goods` VALUES ('28', '鱼香茄子', null, '22', '家常炒菜', '18.00', '9999', '1', '2a6c020302514bd7b61aa2b3e279e02b.jpeg', '29fc7eac7e584ab0bd600c1ace5bd7f4.jpg', '087a19fb70cd4ef6a62a0aee85e8e9d1.jpg', '44f9615d79c64e57b51faa0f5bbba49c.jpg', 'a773afb79a19423a80e8f7751a70da46.jpg', null, null, '鱼香茄子是一道菜品，是四川省传统的特色名菜之一。属于川菜系中比较具有代表性的鱼香味型的名菜。鱼香系列的川菜，最主要的辅料郫县豆瓣。主料配以郫县豆瓣加上其他调料烧出来的菜肴，其味厚重悠长，余味缭绕，回味无穷，故称余香。', null, '10', null, null, null, null, null, null, null, null, '2021-05-12 21:39:04', '2021-05-17 08:04:04');
INSERT INTO `tb_sys_goods` VALUES ('29', '锅包肉', null, '25', '招牌必点', '48.00', '9999', '1', 'ea8959d96fb54ea7b077b58b001a8d96.jpg', 'a8823e6d0c7741698251eb89b3271884.jpg', '4d19118fc8ab4539961a685f41076142.jpg', 'c16d519d40434d1a93f88addab48b786.jpg', 'd67a45f1e55d4112a7a144a98b33f9f1.jpg', null, null, '锅包肉（英文名：Fried Pork in Scoop），原名锅爆肉，光绪年间始创自哈尔滨道台府府尹杜学瀛厨师郑兴文之手。 成菜后，色泽金黄，口味酸甜。\r\n锅包肉是为适应外宾口味，把咸鲜口味的“焦烧肉条”改成了一道酸甜口味的菜肴。通常将猪里脊肉切片腌入味，裹上炸浆，下锅炸至金黄色捞起，再下锅拌炒勾芡即成。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 09:42:53', null);
INSERT INTO `tb_sys_goods` VALUES ('30', '酸菜鱼', null, '22', '家常炒菜', '45.00', '9998', '1', 'a66daef3ba3048898fbdc376ab7530fe.jpg', 'fe247e1338c04a2497eee7cad86f7c5d.jpg', 'd9268c2b714e43129cbebd8c662a24f4.jpg', '7d725414ea6a4aa6965f708e273e5daf.jpg', '69e8b040413142a7b703250cc8677d0d.jpg', null, null, '酸菜鱼也称为酸汤鱼，是一道源自重庆市的经典菜品，以其特有的调味和独特的烹调技法而著称。流行于上世纪90年代，是重庆江湖菜的开路先锋之一。\r\n酸菜鱼以草鱼为主料，配以泡菜等食材煮制而成，口味酸辣可口；鱼含丰富优质蛋白，能提供人丰富的蛋白质、矿物质等营养；酸菜中的乳酸可以促进人体对铁元素的吸收，还可以增加人的食欲。', '1', '10', null, null, null, null, null, null, null, null, '2021-05-17 15:14:40', null);
INSERT INTO `tb_sys_goods` VALUES ('31', '可口可乐', null, '17', '饮品酒水', '3.00', '9999', '1', 'd93d75b0522845398e7c6f4b04a9ad75.jpeg', 'a5ec44bb382441e49baa94194e50c559.jpg', 'f6021ff96e064371b3d06f909a67ca4b.jpg', 'bb7313e0214446eb9cd3591e2cc3ab02.jpg', 'a90bb5a30f304d86901d8495ec948ee5.jpg', null, null, '300ml，爽口可乐', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:20:10', null);
INSERT INTO `tb_sys_goods` VALUES ('32', '雪碧', null, '17', '饮品酒水', '3.00', '9999', '1', '3440f3b585cb44a3934cc8755fa287d9.jpg', '752c2618dca74dd9b824365d198b2ab6.jpg', '8a34216a3eac42e48c61da63d3d8c6cc.jpg', 'b8dc6d93dd1247d396bca58f144869c3.jpg', 'c5638cd6f73e45a1a51628b0a6c13092.jpg', null, null, '300ml，酷爽雪碧', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:22:39', null);
INSERT INTO `tb_sys_goods` VALUES ('33', '家常豆腐', null, '21', '清炒时蔬', '11.00', '9999', '1', '6c9cd98caa89425db2be0da07a1a58f5.jpg', '4ea470ab12fa4e59aa2067a4f8cc1564.jpg', '4aa1ab2b968c46d1b0303ce8d4032d65.jpg', '90a7cbec9fc64080aed1832d86c45707.jpg', '74db6cc16dfe4163888ea3357e5e3015.jpg', null, null, '家常豆腐，是一道以豆腐、猪肉作为主要食材，以豆瓣酱、白糖和酱油作为调料制作而成的老少皆宜的美味食品，酸甜苦辣皆宜，味道浓郁。其中含有铁、钙、磷、镁等人体必需的多种微量元素，还含有糖类、植物油和丰富的优质蛋白。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:28:50', null);
INSERT INTO `tb_sys_goods` VALUES ('34', '炒空心菜', null, '21', '清炒时蔬', '13.00', '9999', '1', 'f0b09b0c046546e986b8648f7b7abbc0.jpg', '315738557d2845cebf66a2f29688291c.jpg', '49dc7b33b77042fbb7b0ba869245dcb8.jpg', '8a2f66477cc246db9a22c69f0b5c9b67.jpg', '0539f35e68c440d098ef54d6413873c6.jpg', null, null, '炒空心菜是由空心菜为主要食材做成的一道菜品，是一道四川省的传统名菜，属于川菜系。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:36:10', null);
INSERT INTO `tb_sys_goods` VALUES ('35', '炒木耳', null, '21', '清炒时蔬', '10.00', '9999', '1', '5cb715210b7a448491e9732cee564e39.jpg', '9609843d7dce48ebbfb6a53463e12912.jpg', 'c9200d83bea24545b3c5cd562b6761f1.jpg', 'a3d819523e3f4615833fdb72bcb8e9ef.jpg', '2335ede833054ace9a8d45067ca7c895.jpg', null, null, '炒木耳是一道菜品，制作原料有木耳，小葱，盐等。黑木耳有活轿抗凝的作用，适合心脑血管疾病、结石症患者食用。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:38:58', null);
INSERT INTO `tb_sys_goods` VALUES ('36', '酸辣白菜', null, '21', '清炒时蔬', '10.00', '9999', '1', 'b09dd776093641ed9cd15207b894a36a.jpeg', '31949afc951b406790270d270978e077.jpg', 'd13682015b1d48359cf84c2d098e0053.jpg', '48b17e2687e94ad0b9197d0f9f4899e9.jpg', '3c1ce921c9194397a83c892074691951.jpg', null, null, '酸辣白菜是一道四川省的传统名菜，属于川菜系。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:45:23', null);
INSERT INTO `tb_sys_goods` VALUES ('37', '千里香馄饨', null, '20', '特色小吃', '6.00', '9999', '1', 'f086eb30ddb64876bfcd556ad0075cec.jpg', '378db1d4cf534efe90c33c09a5390ff1.jpg', 'c94762bced0f4a40bdf61ba9916c0c24.jpg', '51e1c022fe884d3d937efcde5d96bb07.jpg', 'ea302edcbe594b9a85bb440a2852a6e3.jpg', null, null, '千里香馄饨，是福建的著名的小吃，风靡全中国，它以独特的口感，香味独特，深受广大朋友的喜爱。在各地是深受欢迎。\r\n千里香馄饨皮薄其加了澄粉，汤鲜其用老汤，香是用千里香油，这是它主要特点。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:49:29', null);
INSERT INTO `tb_sys_goods` VALUES ('38', '陕西腊汁肉夹馍', null, '20', '特色小吃', '8.00', '9999', '1', '612634599b9e48238b4e1e2f3827a85b.jpg', 'aa50f20ac6a34bbfb49a29902f912de4.jpg', '5793ffa68323430e9dd37839c0ba2291.jpg', '2b9ac531421445eaa79c9d47258a8c77.jpg', 'c8c22c70476c4b05960ec344036a602f.jpg', null, null, '陕西有个白吉镇，这个地方的饼很好吃，很有特色，所以把这种馍叫白吉馍。白吉馍据称源自咸阳。是用上好面粉揉制后做成饼形，置铁铛板上略烤成型，放入炉膛侧立，上下隔着铁铛板的炭火烘烤，稍顷翻面，双面焦黄即可。上品白吉馍揉制充分，火候恰到好处。制好的白吉馍形似\"铁圈虎背菊花心\",皮薄松脆，内心软绵。可单独食用，配腊汁肉同食味道更佳。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 15:56:42', '2021-05-17 16:20:59');
INSERT INTO `tb_sys_goods` VALUES ('39', '小酥肉', null, '22', '家常炒菜', '35.00', '9999', '1', 'c3813ed445594a53bf9910069d5fe79b.jpg', 'fa7fc13717c9448e9f8e37dd5c3ebe8f.jpg', '9e97540833bf4d5bb68a90e48850e349.jpg', '1e5e8c88a1274c1690b680cd67aec2ee.jpg', 'b0cc4d515cdb4416b47de55f23bf1691.jpg', null, null, '酥肉是一道特色传统名菜，山西省、陕西省、河南省等地的特色小吃，香酥、嫩滑、爽口、肥而不腻，在中国各地较为常见，主要见于山西、河南、江西、湖北、山东、四川、贵州、陕西、云南等地。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 16:18:01', null);
INSERT INTO `tb_sys_goods` VALUES ('40', '煎饼果子', null, '20', '特色小吃', '7.00', '9999', '1', '80af59fd7aaa4a54aef3009f5b469e55.jpg', '6f09fed5354f40f58794c3c892aa2e17.jpg', '4de99a46068c48438fdd7cbf590c9c9b.jpg', '86c4b500960a497691aed6d1a8b3ddfc.jpg', '74d23690e668477880bef35f0b8cad89.jpg', null, null, '煎饼馃子，是中国天津的著名小吃，天津人以它为早点。煎饼馃子由绿豆面薄饼、鸡蛋、还有馃子（油条）或者馃篦儿组成，配以面酱、葱末、腐乳、辣椒酱（可选）作为佐料。', null, '10', null, null, null, null, null, null, null, null, '2021-05-17 16:27:06', null);
INSERT INTO `tb_sys_goods` VALUES ('41', '熏肉大饼', null, '20', '特色小吃', '10.00', '9998', '1', '4fe89dcf8b7d4efca680400fa2b7a8dd.jpg', '8eae2abaa8c645d09e3d7894932e306a.jpg', '4c9e336446b24d8588b1ef464df759a4.jpg', '82745ecf6c9e4c62ba31c8ddce669d4a.jpg', '7ddbe5ac63da48288cd757e98785168e.jpg', null, null, '熏肉大饼是一款沈阳和四平的特色传统名点，主要原料有鲜猪肉等，这道食品其特点是熏肉肥而不腻，瘦而不柴，熏香浓，色泽红；大饼色黄清香，里软外酥层次多。', '2', '5', null, null, null, null, null, null, null, null, '2021-05-17 16:31:31', '2021-05-24 16:14:54');
INSERT INTO `tb_sys_goods` VALUES ('42', '生煎包', null, '20', '特色小吃', '10.00', '9997', '1', 'f71cf6f8825547949f4a9a134438be1f.jpg', 'a8f89a3abc504d7db193741f2dfda7a6.jpg', '2426a4de36544b25a954f53b2b351198.jpg', 'ef1594db76df4b89b7fa593ca49427ec.jpg', '3bf6b07e5ea841b0b3202f4fe0632600.jpg', null, null, '一笼8个，生煎包是流行于上海、浙江、江苏及广东的一种特色传统小吃，简称为生煎，由于上海人习惯称“包子”为“馒头”，古代汉语只有馒头，胡人入华夏之后出现新名词如“包”，因此在上海生煎包称生煎馒头。特点是皮酥、汁浓、肉香、精巧。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不散。原为茶楼、老虎灶（开水店）兼营品种。馅心以鲜猪肉加皮冻为主，20世纪30年代后，上海饮食业有了生煎馒头的专业店，馅心花色也增加了鸡肉、虾仁等多种品种。', '2', '5', null, null, null, null, null, null, null, null, '2021-05-17 16:45:35', '2021-05-24 16:14:48');
INSERT INTO `tb_sys_goods` VALUES ('43', '山西刀削面', null, '19', '面食主食', '12.00', '9998', '1', '4332d1cc76bf496594e26541cb6532db.jpg', '81042c617b37477596cbacf96cac4892.jpg', '3a8b837ac7364137918ef7a03aca6e0a.jpg', '32dcf079b9c84fd28c26ac2795de4f2b.jpg', 'ea322e8c322941a7ab53c8d761e4064a.jpg', null, null, '山西刀削面（Shanxi sliced noodles）别称“驸马面”，是山西省的一种特色传统面食，因其风味独特，驰名中外；据传山西刀削面是唐朝驸马柴绍发明，刀削面全凭刀削，因此得名。用刀削出的面叶，中厚边薄。棱锋分明，形似柳叶。\r\n入口外滑内筋，软而不粘，越嚼越香，刀削面的调料（俗称“浇头”或“调和”），也是多种多样的，有番茄酱、肉炸酱、羊肉汤、金针木耳鸡蛋打卤等，都深受喜食面食者欢迎。它同武汉热干面、北京炸酱面、河南烩面、四川担担面同称为五大面食名品，享有盛誉。', '1', '5', null, null, null, null, null, null, null, null, '2021-05-17 16:51:30', null);
INSERT INTO `tb_sys_goods` VALUES ('44', '河南烩面', null, '19', '面食主食', '12.00', '9999', '1', 'f787d48c34834d9393d2ff90df367919.jpg', 'a642a4449d77424687e31e07b2793845.jpg', '5eeb07442be2442784bc83b3e97217b6.jpg', '6800a015aae047699023c30de881b861.jpg', 'caa04e14703841638df00b2433ed4a71.jpg', null, null, '河南烩面，是中国河南省地方菜品，属于豫菜系。河南烩面以优质高筋面粉为原料，辅以高汤及多种配菜，汤用上等嫩羊肉、羊骨（劈开，露出中间的骨髓）一起煮五个小时以上，先用大火猛滚再用小火煲，其中下七八味中药，以把骨头油熬出来为佳，煲出来的汤白白亮亮，犹如牛乳一样，所以又有人叫白汤。辅料以海带丝、千张丝、粉条、香菜、鹌鹑蛋等，上桌时再外带香菜、辣椒油、糖蒜、辣椒碎等小碟。', null, '5', null, null, null, null, null, null, null, null, '2021-05-17 16:54:36', null);
INSERT INTO `tb_sys_goods` VALUES ('45', '四川担担面', null, '19', '面食主食', '12.00', '9997', '1', '0c7188af9617479abd8bd6172bd60ade.jpg', '2dbd3d98acc749fcb27b7a65fdf78f07.png', '934a23f39aca4dbab8e00c2b89187177.jpg', 'afa5072122e34afeb444e0a42091b07d.jpg', '441fcd40a0e849d098cab9825686aa99.jpg', null, null, '四川担担面是四川省成都市和自贡市的一道传统小吃，属于川菜系，该菜品起源于自贡市 ，由面粉、红辣椒油、芝麻酱、葱花等材料制作而成，是“中国十大面条”之一。\r\n担担面成菜后，面条细薄，卤汁酥香，咸鲜微辣，香气扑鼻，十分入味。此菜在四川广为流传，常作为筵席点心。', '2', '5', null, null, null, null, null, null, null, null, '2021-05-17 16:57:16', '2021-05-24 16:14:52');
INSERT INTO `tb_sys_goods` VALUES ('46', '北京炸酱面', null, '19', '面食主食', '13.00', '9998', '1', '6c2dd9bc54b64aa98add1a8c571bd6be.jpeg', '7675379896ee4f638585ed7cce4e3115.jpg', '1e8b14129da84312a011328a68b632d9.jpg', '89eb957fef2c442abb7101768011c1d0.jpg', 'c96974c47a2c4db995730f723bf0f977.jpg', null, null, '老北京炸酱面是北京市的一道传统小吃，属于北京菜，该菜品由菜码、炸酱拌面条而成，流行于北京 、天津、河北等地。', '1', '5', null, null, null, null, null, null, null, null, '2021-05-17 17:00:39', null);
INSERT INTO `tb_sys_goods` VALUES ('47', '武汉热干面', null, '19', '面食主食', '11.00', '9997', '1', 'af64411538c949d4af932b82dcc9d85c.jpg', '1547f53fbe674d1ebb78a0f4454f367b.jpg', '2a03029358c0447482b8ced530437617.jpg', '8f9b032e1abb4d209838e244c2a8ca58.jpg', '63557d55e88f4e9c9cb87cf3c9669f54.jpg', null, null, '武汉热干面是湖北省武汉市的一种特色小吃，属于湖北菜；该菜品在武汉甚至在全国都颇有名气、家喻户晓、妇孺皆知。武汉热干面人人喜爱，长吃不厌，一点都不夸张；面条需经过水煮、过冷水和过油的工序，再淋上用芝麻酱、香油、香醋、辣椒油等调料做成的酱汁，吃时面条爽滑有筋道、酱汁香浓味美，让人食欲大增。', '2', '5', null, null, null, null, null, null, null, null, '2021-05-17 17:05:33', null);
INSERT INTO `tb_sys_goods` VALUES ('48', '西红柿盖浇饭', null, '19', '面食主食', '11.00', '9997', '1', 'bffdb0e278df42c8a59b7af3c9f845ad.png', 'e0720e3c86cf4598aec02b44f87c41fd.jpg', 'd1835955004d404eb7ae72bdc9e74ed4.jpg', 'e9f26f1d4db243f8af9836b0dc98a348.jpg', 'ded69055e8af4726afb966bf794bc2f0.jpg', null, null, '西红柿鸡蛋盖饭是一道由鸡蛋，西红柿等食材制成浇头搭配米饭的美食。', '2', '5', null, null, null, null, null, null, null, null, '2021-05-17 17:15:20', '2021-05-24 16:14:43');
INSERT INTO `tb_sys_goods` VALUES ('49', '扬州炒饭', null, '19', '面食主食', '11.00', '9996', '1', '862bdd8a48ec403f9dd37c67ab1f96ca.jpg', 'c1fecd6c7cb446c48d31eca0cc13c904.jpg', '6439145e5f104846afdc6c16867f6323.jpg', '4a0ee17a276c4a8aa38033788c964e0a.jpg', '9855b577178742ce8deefca7662d8856.jpg', null, null, '扬州炒饭又名扬州蛋炒饭，是江苏省扬州市的一道传统名菜，属于淮扬菜，其主要食材有米饭、火腿、鸡蛋、虾仁等。\r\n扬州炒饭选料严谨、制作精细、加工讲究，而且注重配色。炒制完成后，颗粒分明、粒粒松散、软硬有度、色彩调和、光泽饱满、配料多样、鲜嫩滑爽、香糯可口。', '3', '5', null, null, null, null, null, null, null, null, '2021-05-17 17:20:29', '2021-05-26 13:30:56');
INSERT INTO `tb_sys_goods` VALUES ('50', '香辣翅中', null, '22', '家常炒菜', '30.00', '9998', '1', '61f4d7a9c9c046dca39308a07255ea18.jpg', 'ca04abf7351c4ad79a93ed77b82841ca.jpg', '9dc6f9b652684c80a8c7070e5209e7d0.jpg', '336fc6d2d0234199b5fc32b85709d7c4.jpg', 'e1ca3172621c40d087ace530bce46abf.jpg', null, null, '香辣翅中是一道简单的家常菜，主料是鸡翅中、鲜红椒、香菜。', '1', '5', null, null, null, null, null, null, null, null, '2021-05-26 13:37:27', '2022-04-23 18:07:21');
