INSERT INTO `tb_sys_order_item` VALUES ('49', '40', '31', 'lee', '49', '11.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"扬州炒饭又名扬州蛋炒饭，是江苏省扬州市的一道传统名菜，属于淮扬菜，其主要食材有米饭、火腿、鸡蛋、虾仁等。\\r\\n扬州炒饭选料严谨、制作精细、加工讲究，而且注重配色。炒制完成后，颗粒分明、粒粒松散、软硬有度、色彩调和、光泽饱满、配料多样、鲜嫩滑爽、香糯可口。\",\"createTime\":\"2021-05-17 17:20:29\",\"field0\":\"1\",\"field1\":\"10\",\"id\":49,\"mainPic\":\"862bdd8a48ec403f9dd37c67ab1f96ca.jpg\",\"name\":\"扬州炒饭\",\"price\":11.00,\"state\":1,\"stock\":9998,\"subPic1\":\"c1fecd6c7cb446c48d31eca0cc13c904.jpg\",\"subPic2\":\"6439145e5f104846afdc6c16867f6323.jpg\",\"subPic3\":\"4a0ee17a276c4a8aa38033788c964e0a.jpg\",\"subPic4\":\"9855b577178742ce8deefca7662d8856.jpg\",\"updateTime\":\"2021-05-24 16:17:32\"}', '炒饭很好吃，鸡蛋很嫩，饭粒粒分明。', null, null, null, null, null, null, null, null, '2021-05-24 16:26:23', null);
INSERT INTO `tb_sys_order_item` VALUES ('50', '41', '31', 'lee', '41', '10.00', '1', '3', null, '{\"categoryId\":20,\"categoryName\":\"特色小吃\",\"content\":\"熏肉大饼是一款沈阳和四平的特色传统名点，主要原料有鲜猪肉等，这道食品其特点是熏肉肥而不腻，瘦而不柴，熏香浓，色泽红；大饼色黄清香，里软外酥层次多。\",\"createTime\":\"2021-05-17 16:31:31\",\"field1\":\"10\",\"id\":41,\"mainPic\":\"4fe89dcf8b7d4efca680400fa2b7a8dd.jpg\",\"name\":\"熏肉大饼\",\"price\":10.00,\"state\":1,\"stock\":9999,\"subPic1\":\"8eae2abaa8c645d09e3d7894932e306a.jpg\",\"subPic2\":\"4c9e336446b24d8588b1ef464df759a4.jpg\",\"subPic3\":\"82745ecf6c9e4c62ba31c8ddce669d4a.jpg\",\"subPic4\":\"7ddbe5ac63da48288cd757e98785168e.jpg\",\"updateTime\":\"2021-05-24 16:14:54\"}', '小酥肉好好吃！', null, null, null, null, null, null, null, null, '2021-05-24 16:27:05', null);
INSERT INTO `tb_sys_order_item` VALUES ('51', '41', '31', 'lee', '39', '35.00', '1', '3', null, '{\"categoryId\":22,\"categoryName\":\"家常炒菜\",\"content\":\"酥肉是一道特色传统名菜，山西省、陕西省、河南省等地的特色小吃，香酥、嫩滑、爽口、肥而不腻，在中国各地较为常见，主要见于山西、河南、江西、湖北、山东、四川、贵州、陕西、云南等地。\",\"createTime\":\"2021-05-17 16:18:01\",\"field1\":\"10\",\"id\":39,\"mainPic\":\"c3813ed445594a53bf9910069d5fe79b.jpg\",\"name\":\"小酥肉\",\"price\":35.00,\"state\":1,\"stock\":9999,\"subPic1\":\"fa7fc13717c9448e9f8e37dd5c3ebe8f.jpg\",\"subPic2\":\"9e97540833bf4d5bb68a90e48850e349.jpg\",\"subPic3\":\"1e5e8c88a1274c1690b680cd67aec2ee.jpg\",\"subPic4\":\"b0cc4d515cdb4416b47de55f23bf1691.jpg\"}', '小酥肉好好吃！', null, null, null, null, null, null, null, null, '2021-05-24 16:27:05', null);
INSERT INTO `tb_sys_order_item` VALUES ('52', '42', '31', 'lee', '36', '10.00', '1', '2', null, '{\"categoryId\":21,\"categoryName\":\"清炒时蔬\",\"content\":\"酸辣白菜是一道四川省的传统名菜，属于川菜系。\",\"createTime\":\"2021-05-17 15:45:23\",\"field1\":\"10\",\"id\":36,\"mainPic\":\"b09dd776093641ed9cd15207b894a36a.jpeg\",\"name\":\"酸辣白菜\",\"price\":10.00,\"state\":1,\"stock\":9999,\"subPic1\":\"31949afc951b406790270d270978e077.jpg\",\"subPic2\":\"d13682015b1d48359cf84c2d098e0053.jpg\",\"subPic3\":\"48b17e2687e94ad0b9197d0f9f4899e9.jpg\",\"subPic4\":\"3c1ce921c9194397a83c892074691951.jpg\"}', null, null, null, null, null, null, null, null, null, '2021-05-24 16:28:11', null);
INSERT INTO `tb_sys_order_item` VALUES ('53', '42', '31', 'lee', '33', '11.00', '1', '1', null, '{\"categoryId\":21,\"categoryName\":\"清炒时蔬\",\"content\":\"家常豆腐，是一道以豆腐、猪肉作为主要食材，以豆瓣酱、白糖和酱油作为调料制作而成的老少皆宜的美味食品，酸甜苦辣皆宜，味道浓郁。其中含有铁、钙、磷、镁等人体必需的多种微量元素，还含有糖类、植物油和丰富的优质蛋白。\",\"createTime\":\"2021-05-17 15:28:50\",\"field1\":\"10\",\"id\":33,\"mainPic\":\"6c9cd98caa89425db2be0da07a1a58f5.jpg\",\"name\":\"家常豆腐\",\"price\":11.00,\"state\":1,\"stock\":9999,\"subPic1\":\"4ea470ab12fa4e59aa2067a4f8cc1564.jpg\",\"subPic2\":\"4aa1ab2b968c46d1b0303ce8d4032d65.jpg\",\"subPic3\":\"90a7cbec9fc64080aed1832d86c45707.jpg\",\"subPic4\":\"74db6cc16dfe4163888ea3357e5e3015.jpg\"}', null, null, null, null, null, null, null, null, null, '2021-05-24 16:28:11', null);
INSERT INTO `tb_sys_order_item` VALUES ('54', '42', '31', 'lee', '31', '3.00', '1', '1', null, '{\"categoryId\":17,\"categoryName\":\"饮品酒水\",\"content\":\"300ml，爽口可乐\",\"createTime\":\"2021-05-17 15:20:10\",\"field1\":\"10\",\"id\":31,\"mainPic\":\"d93d75b0522845398e7c6f4b04a9ad75.jpeg\",\"name\":\"可口可乐\",\"price\":3.00,\"state\":1,\"stock\":9999,\"subPic1\":\"a5ec44bb382441e49baa94194e50c559.jpg\",\"subPic2\":\"f6021ff96e064371b3d06f909a67ca4b.jpg\",\"subPic3\":\"bb7313e0214446eb9cd3591e2cc3ab02.jpg\",\"subPic4\":\"a90bb5a30f304d86901d8495ec948ee5.jpg\"}', null, null, null, null, null, null, null, null, null, '2021-05-24 16:28:11', null);
INSERT INTO `tb_sys_order_item` VALUES ('55', '42', '31', 'lee', '30', '45.00', '1', '1', null, '{\"categoryId\":22,\"categoryName\":\"家常炒菜\",\"content\":\"酸菜鱼也称为酸汤鱼，是一道源自重庆市的经典菜品，以其特有的调味和独特的烹调技法而著称。流行于上世纪90年代，是重庆江湖菜的开路先锋之一。\\r\\n酸菜鱼以草鱼为主料，配以泡菜等食材煮制而成，口味酸辣可口；鱼含丰富优质蛋白，能提供人丰富的蛋白质、矿物质等营养；酸菜中的乳酸可以促进人体对铁元素的吸收，还可以增加人的食欲。\",\"createTime\":\"2021-05-17 15:14:40\",\"field1\":\"10\",\"id\":30,\"mainPic\":\"a66daef3ba3048898fbdc376ab7530fe.jpg\",\"name\":\"酸菜鱼\",\"price\":45.00,\"state\":1,\"stock\":9999,\"subPic1\":\"fe247e1338c04a2497eee7cad86f7c5d.jpg\",\"subPic2\":\"d9268c2b714e43129cbebd8c662a24f4.jpg\",\"subPic3\":\"7d725414ea6a4aa6965f708e273e5daf.jpg\",\"subPic4\":\"69e8b040413142a7b703250cc8677d0d.jpg\"}', null, null, null, null, null, null, null, null, null, '2021-05-24 16:28:11', null);
INSERT INTO `tb_sys_order_item` VALUES ('56', '43', '31', 'lee', '37', '6.00', '1', '1', null, '{\"categoryId\":20,\"categoryName\":\"特色小吃\",\"content\":\"千里香馄饨，是福建的著名的小吃，风靡全中国，它以独特的口感，香味独特，深受广大朋友的喜爱。在各地是深受欢迎。\\r\\n千里香馄饨皮薄其加了澄粉，汤鲜其用老汤，香是用千里香油，这是它主要特点。\",\"createTime\":\"2021-05-17 15:49:29\",\"field1\":\"10\",\"id\":37,\"mainPic\":\"f086eb30ddb64876bfcd556ad0075cec.jpg\",\"name\":\"千里香馄饨\",\"price\":6.00,\"state\":1,\"stock\":9999,\"subPic1\":\"378db1d4cf534efe90c33c09a5390ff1.jpg\",\"subPic2\":\"c94762bced0f4a40bdf61ba9916c0c24.jpg\",\"subPic3\":\"51e1c022fe884d3d937efcde5d96bb07.jpg\",\"subPic4\":\"ea302edcbe594b9a85bb440a2852a6e3.jpg\"}', null, null, null, null, null, null, null, null, null, '2021-05-24 16:29:10', null);
