INSERT INTO `tb_sys_order_item` VALUES ('70', '55', '30', 'janus', '47', '11.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"武汉热干面是湖北省武汉市的一种特色小吃，属于湖北菜；该菜品在武汉甚至在全国都颇有名气、家喻户晓、妇孺皆知。武汉热干面人人喜爱，长吃不厌，一点都不夸张；面条需经过水煮、过冷水和过油的工序，再淋上用芝麻酱、香油、香醋、辣椒油等调料做成的酱汁，吃时面条爽滑有筋道、酱汁香浓味美，让人食欲大增。\",\"createTime\":\"2021-05-17 17:05:33\",\"field1\":\"8\",\"id\":47,\"mainPic\":\"af64411538c949d4af932b82dcc9d85c.jpg\",\"name\":\"武汉热干面\",\"price\":11.00,\"state\":1,\"stock\":9999,\"subPic1\":\"1547f53fbe674d1ebb78a0f4454f367b.jpg\",\"subPic2\":\"2a03029358c0447482b8ced530437617.jpg\",\"subPic3\":\"8f9b032e1abb4d209838e244c2a8ca58.jpg\",\"subPic4\":\"63557d55e88f4e9c9cb87cf3c9669f54.jpg\"}', '很好吃', null, null, null, null, null, null, null, null, '2021-05-30 11:02:56', null);
INSERT INTO `tb_sys_order_item` VALUES ('71', '56', '30', 'janus', '46', '13.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"老北京炸酱面是北京市的一道传统小吃，属于北京菜，该菜品由菜码、炸酱拌面条而成，流行于北京 、天津、河北等地。\",\"createTime\":\"2021-05-17 17:00:39\",\"field1\":\"10\",\"id\":46,\"mainPic\":\"6c2dd9bc54b64aa98add1a8c571bd6be.jpeg\",\"name\":\"北京炸酱面\",\"price\":13.00,\"state\":1,\"stock\":9999,\"subPic1\":\"7675379896ee4f638585ed7cce4e3115.jpg\",\"subPic2\":\"1e8b14129da84312a011328a68b632d9.jpg\",\"subPic3\":\"89eb957fef2c442abb7101768011c1d0.jpg\",\"subPic4\":\"c96974c47a2c4db995730f723bf0f977.jpg\"}', '很好吃', null, null, null, null, null, null, null, null, '2021-05-30 11:11:43', null);
INSERT INTO `tb_sys_order_item` VALUES ('72', '57', '30', 'janus', '45', '12.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"四川担担面是四川省成都市和自贡市的一道传统小吃，属于川菜系，该菜品起源于自贡市 ，由面粉、红辣椒油、芝麻酱、葱花等材料制作而成，是“中国十大面条”之一。\\r\\n担担面成菜后，面条细薄，卤汁酥香，咸鲜微辣，香气扑鼻，十分入味。此菜在四川广为流传，常作为筵席点心。\",\"createTime\":\"2021-05-17 16:57:16\",\"field1\":\"10\",\"id\":45,\"mainPic\":\"0c7188af9617479abd8bd6172bd60ade.jpg\",\"name\":\"四川担担面\",\"price\":12.00,\"state\":1,\"stock\":9999,\"subPic1\":\"2dbd3d98acc749fcb27b7a65fdf78f07.png\",\"subPic2\":\"934a23f39aca4dbab8e00c2b89187177.jpg\",\"subPic3\":\"afa5072122e34afeb444e0a42091b07d.jpg\",\"subPic4\":\"441fcd40a0e849d098cab9825686aa99.jpg\",\"updateTime\":\"2021-05-24 16:14:52\"}', '很好吃', null, null, null, null, null, null, null, null, '2021-05-30 12:13:15', null);
INSERT INTO `tb_sys_order_item` VALUES ('73', '58', '30', 'janus', '45', '12.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"四川担担面是四川省成都市和自贡市的一道传统小吃，属于川菜系，该菜品起源于自贡市 ，由面粉、红辣椒油、芝麻酱、葱花等材料制作而成，是“中国十大面条”之一。\\r\\n担担面成菜后，面条细薄，卤汁酥香，咸鲜微辣，香气扑鼻，十分入味。此菜在四川广为流传，常作为筵席点心。\",\"createTime\":\"2021-05-17 16:57:16\",\"field0\":\"1\",\"field1\":\"10\",\"id\":45,\"mainPic\":\"0c7188af9617479abd8bd6172bd60ade.jpg\",\"name\":\"四川担担面\",\"price\":12.00,\"state\":1,\"stock\":9998,\"subPic1\":\"2dbd3d98acc749fcb27b7a65fdf78f07.png\",\"subPic2\":\"934a23f39aca4dbab8e00c2b89187177.jpg\",\"subPic3\":\"afa5072122e34afeb444e0a42091b07d.jpg\",\"subPic4\":\"441fcd40a0e849d098cab9825686aa99.jpg\",\"updateTime\":\"2021-05-24 16:14:52\"}', '很好吃', null, null, null, null, null, null, null, null, '2021-05-30 12:33:35', null);
INSERT INTO `tb_sys_order_item` VALUES ('74', '58', '30', 'janus', '42', '10.00', '2', '3', null, '{\"categoryId\":20,\"categoryName\":\"特色小吃\",\"content\":\"一笼8个，生煎包是流行于上海、浙江、江苏及广东的一种特色传统小吃，简称为生煎，由于上海人习惯称“包子”为“馒头”，古代汉语只有馒头，胡人入华夏之后出现新名词如“包”，因此在上海生煎包称生煎馒头。特点是皮酥、汁浓、肉香、精巧。轻咬一口，肉香、油香、葱香、芝麻香全部的美味在口中久久不散。原为茶楼、老虎灶（开水店）兼营品种。馅心以鲜猪肉加皮冻为主，20世纪30年代后，上海饮食业有了生煎馒头的专业店，馅心花色也增加了鸡肉、虾仁等多种品种。\",\"createTime\":\"2021-05-17 16:45:35\",\"field1\":\"10\",\"id\":42,\"mainPic\":\"f71cf6f8825547949f4a9a134438be1f.jpg\",\"name\":\"生煎包\",\"price\":10.00,\"state\":1,\"stock\":9999,\"subPic1\":\"a8f89a3abc504d7db193741f2dfda7a6.jpg\",\"subPic2\":\"2426a4de36544b25a954f53b2b351198.jpg\",\"subPic3\":\"ef1594db76df4b89b7fa593ca49427ec.jpg\",\"subPic4\":\"3bf6b07e5ea841b0b3202f4fe0632600.jpg\",\"updateTime\":\"2021-05-24 16:14:48\"}', '很好吃', null, null, null, null, null, null, null, null, '2021-05-30 12:33:35', null);
INSERT INTO `tb_sys_order_item` VALUES ('75', '59', '30', 'janus', '41', '10.00', '2', '3', null, '{\"categoryId\":20,\"categoryName\":\"特色小吃\",\"content\":\"熏肉大饼是一款沈阳和四平的特色传统名点，主要原料有鲜猪肉等，这道食品其特点是熏肉肥而不腻，瘦而不柴，熏香浓，色泽红；大饼色黄清香，里软外酥层次多。\",\"createTime\":\"2021-05-17 16:31:31\",\"field1\":\"10\",\"id\":41,\"mainPic\":\"4fe89dcf8b7d4efca680400fa2b7a8dd.jpg\",\"name\":\"熏肉大饼\",\"price\":10.00,\"state\":1,\"stock\":10000,\"subPic1\":\"8eae2abaa8c645d09e3d7894932e306a.jpg\",\"subPic2\":\"4c9e336446b24d8588b1ef464df759a4.jpg\",\"subPic3\":\"82745ecf6c9e4c62ba31c8ddce669d4a.jpg\",\"subPic4\":\"7ddbe5ac63da48288cd757e98785168e.jpg\",\"updateTime\":\"2021-05-24 16:14:54\"}', '非常好吃', null, null, null, null, null, null, null, null, '2021-05-30 14:02:29', null);
INSERT INTO `tb_sys_order_item` VALUES ('76', '59', '30', 'janus', '43', '12.00', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"山西刀削面（Shanxi sliced noodles）别称“驸马面”，是山西省的一种特色传统面食，因其风味独特，驰名中外；据传山西刀削面是唐朝驸马柴绍发明，刀削面全凭刀削，因此得名。用刀削出的面叶，中厚边薄。棱锋分明，形似柳叶。\\r\\n入口外滑内筋，软而不粘，越嚼越香，刀削面的调料（俗称“浇头”或“调和”），也是多种多样的，有番茄酱、肉炸酱、羊肉汤、金针木耳鸡蛋打卤等，都深受喜食面食者欢迎。它同武汉热干面、北京炸酱面、河南烩面、四川担担面同称为五大面食名品，享有盛誉。\",\"createTime\":\"2021-05-17 16:51:30\",\"field1\":\"10\",\"id\":43,\"mainPic\":\"4332d1cc76bf496594e26541cb6532db.jpg\",\"name\":\"山西刀削面\",\"price\":12.00,\"state\":1,\"stock\":9999,\"subPic1\":\"81042c617b37477596cbacf96cac4892.jpg\",\"subPic2\":\"3a8b837ac7364137918ef7a03aca6e0a.jpg\",\"subPic3\":\"32dcf079b9c84fd28c26ac2795de4f2b.jpg\",\"subPic4\":\"ea322e8c322941a7ab53c8d761e4064a.jpg\"}', '非常好吃', null, null, null, null, null, null, null, null, '2021-05-30 14:02:29', null);
INSERT INTO `tb_sys_order_item` VALUES ('77', '59', '30', 'janus', '24', '22.00', '1', '3', null, '{\"categoryId\":24,\"categoryName\":\"限时特惠\",\"content\":\"宫保鸡丁（Kung Pao Chicken），是一道闻名中外的特色传统名菜。宫保鸡丁选用鸡肉为主料，佐以花生米、辣椒等辅料烹制而成；红而不辣、辣而不猛、香辣味浓、肉质滑脆；其入口鲜辣，鸡肉的鲜嫩可以配合花生的香脆。2018年9月，被评为“中国菜”之贵州十大经典名菜、四川十大经典名菜。\",\"createTime\":\"2021-05-12 21:15:00\",\"field1\":\"8\",\"id\":24,\"mainPic\":\"64c6b01edb2f4828827094320230959d.jpeg\",\"name\":\"宫保鸡丁\",\"price\":22.00,\"state\":1,\"stock\":10000,\"subPic1\":\"226d8f1734e34998b6ff08b73e73cb1f.jpg\",\"subPic2\":\"723c841d06e744bca15a9e619d2e335a.jpg\",\"subPic3\":\"3ed569e9c74248bba5491b7dce9357c0.jpg\",\"subPic4\":\"c280e96bcd464e2a9ad050f49d85a075.jpg\"}', '非常好吃', null, null, null, null, null, null, null, null, '2021-05-30 14:02:29', null);
INSERT INTO `tb_sys_order_item` VALUES ('78', '60', '30', 'janus', '47', '8.80', '1', '3', null, '{\"categoryId\":19,\"categoryName\":\"面食主食\",\"content\":\"武汉热干面是湖北省武汉市的一种特色小吃，属于湖北菜；该菜品在武汉甚至在全国都颇有名气、家喻户晓、妇孺皆知。武汉热干面人人喜爱，长吃不厌，一点都不夸张；面条需经过水煮、过冷水和过油的工序，再淋上用芝麻酱、香油、香醋、辣椒油等调料做成的酱汁，吃时面条爽滑有筋道、酱汁香浓味美，让人食欲大增。\",\"createTime\":\"2021-05-17 17:05:33\",\"field0\":\"1\",\"field1\":\"8\",\"id\":47,\"mainPic\":\"af64411538c949d4af932b82dcc9d85c.jpg\",\"name\":\"武汉热干面\",\"price\":11.00,\"state\":1,\"stock\":9998,\"subPic1\":\"1547f53fbe674d1ebb78a0f4454f367b.jpg\",\"subPic2\":\"2a03029358c0447482b8ced530437617.jpg\",\"subPic3\":\"8f9b032e1abb4d209838e244c2a8ca58.jpg\",\"subPic4\":\"63557d55e88f4e9c9cb87cf3c9669f54.jpg\"}', '非常好吃', null, null, null, null, null, null, null, null, '2021-05-30 14:06:18', null);
INSERT INTO `tb_sys_order_item` VALUES ('79', '61', '30', 'janus', '26', '28.00', '3', '1', null, '{\"categoryId\":24,\"categoryName\":\"限时特惠\",\"content\":\"糖醋里脊是中国经典传统名菜之一，该菜品以猪里脊肉为主材，配以面粉、淀粉、醋等佐料，酸甜可口，让人食欲大开；该菜品在豫菜、浙菜、鲁菜、川菜、淮扬菜、粤菜、闽菜里均有此菜。2018年9月10日，“中国菜”在河南省正式发布。糖醋里脊被评为山东十大经典名菜。\",\"createTime\":\"2021-05-12 21:20:16\",\"field1\":\"8\",\"id\":26,\"mainPic\":\"52b662d0854646968bb8ec3333e4dc7c.jpg\",\"name\":\"糖醋里脊\",\"price\":28.00,\"state\":1,\"stock\":9998,\"subPic1\":\"615bb27a96ee41b1a498485824293ac9.jpg\",\"subPic2\":\"bb7ec761ba58432cba27773088963184.jpg\",\"subPic3\":\"a54ef31a9e7746bbb40f8fd0d61a0f1f.jpg\",\"subPic4\":\"1404868ac9e2440ab5b45facce0d4e13.jpg\"}', null, null, null, null, null, null, null, null, null, '2022-04-23 18:09:19', null);
INSERT INTO `tb_sys_order_item` VALUES ('80', '62', '30', 'janus', '30', '45.00', '1', '0', null, '{\"categoryId\":22,\"categoryName\":\"家常炒菜\",\"content\":\"酸菜鱼也称为酸汤鱼，是一道源自重庆市的经典菜品，以其特有的调味和独特的烹调技法而著称。流行于上世纪90年代，是重庆江湖菜的开路先锋之一。\\r\\n酸菜鱼以草鱼为主料，配以泡菜等食材煮制而成，口味酸辣可口；鱼含丰富优质蛋白，能提供人丰富的蛋白质、矿物质等营养；酸菜中的乳酸可以促进人体对铁元素的吸收，还可以增加人的食欲。\",\"createTime\":\"2021-05-17 15:14:40\",\"field1\":\"10\",\"id\":30,\"mainPic\":\"a66daef3ba3048898fbdc376ab7530fe.jpg\",\"name\":\"酸菜鱼\",\"price\":45.00,\"state\":1,\"stock\":9999,\"subPic1\":\"fe247e1338c04a2497eee7cad86f7c5d.jpg\",\"subPic2\":\"d9268c2b714e43129cbebd8c662a24f4.jpg\",\"subPic3\":\"7d725414ea6a4aa6965f708e273e5daf.jpg\",\"subPic4\":\"69e8b040413142a7b703250cc8677d0d.jpg\"}', null, null, null, null, null, null, null, null, null, '2022-04-23 18:10:21', null);
